INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'Erik Tolentino is a future web developer with knowledge in PHP, JavaScript, and Drupal!\r\n\r\nView his GitHub here: <a href="https://github.com/tolentino3575" target=_blank>GitHub</a>', '', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, 'Here is a heroku link to the CRATE application Erik and his team worked on!\r\n\r\n<a href="http://crate-app.herokuapp.com" target=_blank>CRATE</a>', '', 'filtered_html'),
('node', 'article', 0, 5, 5, 'und', 0, 'Here is a link to the GitHub repository for an EmberJS project Erik worked on!\r\n\r\n<a href="https://github.com/tolentino3575/EmberJS-BeerEventFinder.git" target=_blank>Beer Event Finder</a>', '', 'filtered_html'),
('node', 'restaurants_reviews', 0, 6, 6, 'und', 0, 'This location has been open a couple weeks and the lines are still long. To enter the restaurant was about 15 minutes, and the drive through wrapped all the way back to Target. The food tasted like any other Chic Fil A, but they only gave me one sauce for the whole meal. Wtf. ', '', 'filtered_html'),
('node', 'page', 0, 7, 7, 'und', 0, '<div id=''mymodule-ajax-wrapper''>\r\n<p>Click on a title to view the node!</p>\r\n</div>', '', 'full_html'),
('node', 'article', 0, 9, 9, 'und', 0, 'This is the first test', '', 'filtered_html'),
('node', 'article', 0, 10, 10, 'und', 0, 'This is the second test', '', 'filtered_html');
